import React from 'react'
import {Card,Form,Input,Cascader,Upload,Button,Icon} from "antd"
import LinkButton from "../../components/link-button";

const {Item} = Form
const {TextArea} = Input
export default class ProductAddUpdate extends React.Component {
    render(){

        const title = (
            <span>
                <LinkButton>
                    <Icon type="arrow-left" style={{fontSize:20}}/>
                </LinkButton>
                <span>添加商品</span>
            </span>
        )

        const formItemLayout = {
            labelCol: { span: 2 },
            wrapperCol: { span: 8},
        };
        return (
            <Card title={title}>
                <Form {...formItemLayout}>
                    <Item label="商品名称:">
                        <Input placeholder="商品名称"></Input>
                    </Item>
                    <Item label="商品描述:">
                        <TextArea aria-placeholder="商品描述" placeholder="Autosize height based on content lines" autoSize />
                    </Item>
                </Form>
            </Card>
        )
    }
}
